import React, { Component } from 'react';
import './AnaKisim.css';
import Logo from './Logo.js';
class AnaKisim extends Component {
    render() {
        return (
            <div className='AnaKisim'>
             <Logo></Logo>
              </div>
        )
    }
}
export default AnaKisim;
